import React from 'react';

import { AiTwotoneHome } from "react-icons/all";

import { Wrapper, Header, Button, Box, Text, Login  } from './styles';

import logo from '../../assets/images/logo.png';

function Main() {
  return (
      <Wrapper>
        <Header>
                <img src={logo}/>
        </Header>
        
        <body>
            <Box >
                <Text>Entrar</Text>
                <Login >
                    <input type="text" id="usuario" placeholder="Email ou  nÃºmero de telefone" />
                    <input type="text" id="senha" placeholder="Senha" />
                    
                    <Button>
                        <span>Entrar</span>
                  </Button>

                </Login>
            </Box>
                  
            
        </body>
      </Wrapper>  
  )
}

export default Main;
